package reactormode.sessions.http;import reactormode.buffer.DirectByteBufferPools;import reactormode.handle.httphandle.HttpNIOHandle;import reactormode.sessions.SessionManager;import java.nio.channels.ClosedChannelException;import java.nio.channels.Selector;import java.nio.channels.SocketChannel;/** * Created by demopoo on 2017/9/9. */public class HttpSessionsManager implements SessionManager<HttpSessions> {    public HttpSessions createSession(Selector selector, SocketChannel socketChannel, DirectByteBufferPools directByteBufferPools) throws ClosedChannelException {        HttpSessions httpSessions = new HttpSessions(selector,socketChannel,directByteBufferPools);        httpSessions.setCurNIOHandler(new HttpNIOHandle());        return httpSessions;    }}